import { Breadcrumb } from '@fluentui/react';
import React from 'react';
import Header from '../design/header';
import LayoutBase from '../design/layout/layout-base';
import Solutions from '../design/solutions';

const SolutionsPage: React.FC = () => {
  return (
    <LayoutBase
      header={
        <Header
          image="https://res.cloudinary.com/code-comunity/image/upload/v1633436182/site-gok/Imagem_BG_st7viu.png"
          title="Nossa estrutura é totalmente flexivel"
          description={<ul style={{ display: 'flex' }}> <li>Criação</li> <li>Squad</li> </ul>}
        />
      }
      content={<Solutions />}
    />
  )
}

export default SolutionsPage;
